import React from "react";

const Logo = function () {
  function gohome() {
    window.location = "../";
  }

  return (
    <div onClick={gohome}>
      <b>
        interBuild.&nbsp;
        {/* <i className="fa fa-paint-brush" aria-hidden="true"></i>
          <i className="fa fa-wrench" aria-hidden="true"></i> */}
      </b>
    </div>
  );
};

export default Logo;
